import { parse } from "qs";

const App = () => {
  useEffect(() => {
    for (let i = 0; i < 10; i++) {
      for (let j = 0; j < 10; j++) {
        console.log("okok" + j);
      }
    }
  });

  return (
    <>
      <div className="app">
        <input type="text" id="password-output" value="Générateur de Mdp" />
      </div>
    </>
  );
};

export default App;
